import React, { Component } from 'react'

class UtilFunctions extends Component {



    static randomNumber(str) {
        var seed = 1;
        function random() {
            var x = Math.sin(seed++) * 10000;
            return x - Math.floor(x);
        }

    }







}

export default UtilFunctions
